import React from 'react';
import { Link } from "react-scroll";

function App() {
  return (
    <div className="App" style={styles.appBackground}>
      <Navbar />
      <Home />
      <OurTeam />
      <OurWork />
      <ContactUs />
    </div>
  );
}

function Navbar() {
  return (
    <div>
      <Link 
        to="homeSection" 
        smooth={true} 
        duration={500}
      >
        Home
      </Link>
      <Link 
        to="teamSection" 
        smooth={true} 
        duration={500}
      >
        Our Team
      </Link>
      <Link 
        to="workSection" 
        smooth={true} 
        duration={500}
      >
        Our Work
      </Link>
      <Link 
        to="contactSection" 
        smooth={true} 
        duration={500}
      >
        Contact Us
      </Link>
    </div>
  );
}

function Home() {
  return (
    <div id="homeSection">
      {/* Home content */}
    </div>
  );
}

function OurTeam() {
  return (
    <div id="teamSection">
      {/* OurTeam content */}
    </div>
  );
}

function OurWork() {
  return (
    <div id="workSection">
      {/* OurWork content */}
    </div>
  );
} 

function ContactUs() {
  return (
    <div id="contactSection">
      {/* ContactUs content */}
    </div>
  );
}

const styles = {
  appBackground: {
    background: 'linear-gradient(45deg, #FE6B8B 30%, #FF8E53 90%)', // Gradient from pink to orange
    height: '100vh',
    width: '100vw',
    position: 'fixed',
    top: 0,
    left: 0,
  }
};

export default App;
